DROP TABLE IF EXISTS `reference_peptides`;
CREATE TABLE IF NOT EXISTS `reference_peptides` (
  `reference_id`       INT         NOT NULL AUTO_INCREMENT,
  `reference_hash`     CHAR(40)    NOT NULL,
  `reference_sequence` LONGBLOB    NOT NULL,
  `reference_type`      VARCHAR(20) NOT NULL,

  PRIMARY KEY (`reference_id`),
  UNIQUE INDEX `reference_hash_UNIQUE` (`reference_hash` ASC)
) ENGINE = InnoDB;

DROP TABLE IF EXISTS `bioactive_peptides`;
CREATE TABLE IF NOT EXISTS `bioactive_peptides` (
  `peptide_hash`         CHAR(40) NOT NULL,
  `reference_hash`       CHAR(40) NOT NULL,
  `bioactive_similarity` DOUBLE   NOT NULL,

  PRIMARY KEY (`peptide_hash`, `reference_hash`),
  CONSTRAINT `fk_bioactive_peptides1`
    FOREIGN KEY (`peptide_hash`)
    REFERENCES peptides (`peptide_hash`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_bioactive_reference1`
    FOREIGN KEY (`reference_hash`)
    REFERENCES `reference_peptides` (`reference_hash`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION
) ENGINE = InnoDB;

